import React, { Component } from 'react'
import './details.component.css';
import { connect } from 'react-redux';
import { fetchDetails_ac } from '../../../actions/details/detailsActions'

class DetailsSingle extends Component {
    componentDidMount(){
        this.props.fetchDetails();
        console.log('props in details single>>', this.props);
    }
    render() {
        return (
            <div>
                {this.props.details.length > 0 && this.props.details.map((item,i) => (
                    <div className="detailSingle" key={i}>
                        <p>Company Address is : {item.companyAddress}</p>
                        <p>Company PhoneNumber is : {item.companyPhone}</p>
                        <p>Company Email is : {item.companyEmail}</p>
                        {item.fbLink &&
                        <p>FacebookLink is : {item.fbLink}</p>
                        }
                        {item.instaLink &&
                        <p>FacebookLink is : {item.instaLink}</p>
                        }
                        {item.twitterLink &&
                        <p>FacebookLink is : {item.twitterLink}</p>
                        }

                    </div>
                ))}
            </div>
        )
    }
}

const mapStateToProps = store => ({
    details: store.detail.details
})

const mapDispatchToProps = dispatch => ({
    fetchDetails: () => dispatch(fetchDetails_ac())
})

export default connect(mapStateToProps, mapDispatchToProps)(DetailsSingle)
